const WeekCell = ({ data, date }) => {

    let tasksinaday = Array.from(data);
    tasksinaday.filter((item)=> item.date == date);

    return (
        <div className="weekcell">
            <p>weekcell</p>
        </div>
    )
}

export default WeekCell;
